import React from 'react';
import Card from './Card';

const CardList = ({ pokemon }) => {
    return (    
        <div>
            {
                pokemon.map((pokemon, i) => {
                    return (
                        <Card
                            key={i}
                            id={pokemon[i].id}
                            name={pokemon[i].name}
                            height={pokemon[i].height}
                            weight={pokemon[i].weight}
                            type={pokemon[i].type}
                        />
                    );
                })
            }
        </div>
    );
}

export default CardList;
